function Login() {
  const googleLogin = () => {
    window.open('http://localhost:5000/auth/google', '_self');
  };

  return (
    <div>
      <h2>Login</h2>
      <button onClick={googleLogin}>Login with Google</button>
    </div>
  );
}

export default Login;
